import Link from 'next/link';

const linkStyle = {
    marginRight: 15
}

const Nav = () => {
    return (
        <aside>
            <Link href="/">
                <a style={linkStyle}>Home</a>
            </Link>
            <Link href="/about">
                <a style={linkStyle}>About</a>
            </Link>
        </aside>
    );
}

export default Nav;
